const oldTwitterIconBase64 = "";


function replaceDogeIcon() {
  const dogeIconBase64 = "iVBORw0KGgoAAAANSUh";
  const svgImages = document.getElementsByTagName("svg");
  console.log("running!")
  for (let i = 0; i < svgImages.length; i++) {
    const img = svgImages[i];
    if (img.outerHTML.includes(dogeIconBase64)) {
      console.log("found!")
      img.outerHTML = '<svg viewBox="0 0 24 24" aria-hidden="true"><g><pattern height="1" id="0-a" patternContentUnits="objectBoundingBox" width="1"><image height="100" transform="scale(.01 .0087)" width="100" xlink:href="data:image/png;data:image/png;base64,' + oldTwitterIconBase64 + '"></image></pattern><path d="M2.412.974h19.176v22.052H2.412z" fill="url(#0-a)"></path></g></svg>';
     
    }
  }
}

// Wait for the content to fully load
window.addEventListener("load", () => {
  setTimeout(replaceDogeIcon, 1000);
});
